import "../styles.css";
import "pure-react-carousel/dist/react-carousel.es.css";
import React from "react";
import { wrapper } from "../Redux/index.ts";

const MyApp = ({ Component, pageProps }) => <Component {...pageProps} />;

export default wrapper.withRedux(MyApp);
